            <p className="w-[1090px] text-[14px] font-normal px-6 text-[#161616]">
              Гүйцэтгэгчид маш мэргэжлийн, хурдан бөгөөд чанартай үйлчилгээ
              үзүүлсэн. Би ажлын явцын талаар байнга мэдээлэл авч, асуусан
              асуултууддаа цаг тухайд нь хариулт авсан. Ажлын хугацаа болон
              төсвийг яг таг барьж дуусгасан нь хамгийн их таалагдсан.
            </p>
